import React from 'react'

import counter from '../store/counter'

export default function Counter() {
    console.log(counter)
    return (
        <div>

            Counter {counter.count}
            <hr />
            <button onClick={() => counter.increment()}>add</button>
            <button onClick={() => counter.decrement()}>sub</button>
        </div>
    )
}
